import { CSSTransition } from "react-transition-group";

function About() {
  return (
    <>
      <div className="about-title">
        <p>Half developer,</p><br/>
        <p>half designer,</p>
        <p>full creative</p>
      </div>
    </>
  );
}

export default About;
